import React from 'react';

const CreateCanvas = (props) => {
  return (
    <div id="create-canvas">
      <h1> Create a New Canvas </h1>
      <img src='/../worldpin_canvas_background.png' alt='background' />
    </div>
  )
}

export default CreateCanvas;
